class WeatherModel {
  WeatherModel({
      double lat, 
      double lon, 
      String timezone, 
      int timezoneOffset, 
      Current current, 
      List<Hourly> hourly, 
      List<Daily> daily,}){
    _lat = lat;
    _lon = lon;
    _timezone = timezone;
    _timezoneOffset = timezoneOffset;
    _current = current;
    _hourly = hourly;
    _daily = daily;
}

  WeatherModel.fromJson(dynamic json) {
    _lat = json['lat'];
    _lon = json['lon'];
    _timezone = json['timezone'];
    _timezoneOffset = json['timezone_offset'];
    _current = json['current'] != null ? Current.fromJson(json['current']) : null;
    if (json['hourly'] != null) {
      _hourly = [];
      json['hourly'].forEach((v) {
        _hourly.add(Hourly.fromJson(v));
      });
    }
    if (json['daily'] != null) {
      _daily = [];
      json['daily'].forEach((v) {
        _daily.add(Daily.fromJson(v));
      });
    }
  }
  double _lat;
  double _lon;
  String _timezone;
  int _timezoneOffset;
  Current _current;
  List<Hourly> _hourly;
  List<Daily> _daily;
WeatherModel copyWith({  double lat,
  double lon,
  String timezone,
  int timezoneOffset,
  Current current,
  List<Hourly> hourly,
  List<Daily> daily,
}) => WeatherModel(  lat: lat ?? _lat,
  lon: lon ?? _lon,
  timezone: timezone ?? _timezone,
  timezoneOffset: timezoneOffset ?? _timezoneOffset,
  current: current ?? _current,
  hourly: hourly ?? _hourly,
  daily: daily ?? _daily,
);
  double get lat => _lat;
  double get lon => _lon;
  String get timezone => _timezone;
  int get timezoneOffset => _timezoneOffset;
  Current get current => _current;
  List<Hourly> get hourly => _hourly;
  List<Daily> get daily => _daily;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['lat'] = _lat;
    map['lon'] = _lon;
    map['timezone'] = _timezone;
    map['timezone_offset'] = _timezoneOffset;
    if (_current != null) {
      map['current'] = _current.toJson();
    }
    if (_hourly != null) {
      map['hourly'] = _hourly.map((v) => v.toJson()).toList();
    }
    if (_daily != null) {
      map['daily'] = _daily.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

